sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "subscription","ackDeadlineSeconds"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "subscription"]);
    var acknowledgeIDs = pubSub.newArrayObject(inputs.acknowledgeids);
    if (acknowledgeIDs.length < 0)
        throw new Error("Atleast one Acknowledge ID is required");
    outputs.payload = JSON.stringify({
        "ackIds": acknowledgeIDs,
        "ackDeadlineSeconds": inputs.ackDeadlineSeconds
    });
})(inputs, outputs);

